from typing import List

class Solution:
    def maxVowels(self, s: str, k: int) -> int:
        vowel = 'aiueo'
        wadah = s[:k]
        akhir = len([i for i in wadah if i in vowel])
        result = akhir

        for i in range(1, len(s)-k+1):
            if s[i-1] in vowel:
                akhir -= 1
            if s[i+k-1] in vowel:
                akhir += 1
            result = max(result, akhir)
        return result


if __name__ == "__main__":
    test = Solution()
    # s1 = "abciiidef"
    s1 = "abciiidef"
    k1 = 3
    # Output: 3

    s2 = "aeiou"
    k2 = 2
    # Output: 2

    s3 = "leetcode"
    k3 = 3
    # Output: 2

    s4 = ""
    k4 = 50436
    # Output: 9694

    print(test.maxVowels(s1,k1))
    print(test.maxVowels(s2,k2))
    print(test.maxVowels(s3,k3))
    print(test.maxVowels(s4,k4))